import vtkLegacyAsciiParser from './Legacy/LegacyAsciiParser.js';
import vtkPolyDataReader from './Legacy/PolyDataReader.js';

var Legacy = {
  vtkLegacyAsciiParser: vtkLegacyAsciiParser,
  vtkPolyDataReader: vtkPolyDataReader
};

export { Legacy as default };
